echo "<script>
    var d = new Date();
    const months = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'];
    var month = d.getMonth();
    var day = d.getDate();
    var hour = d.getHours();
    var minute = d.getMinutes();
    
    var ap = 'AM';
    if (hour >= 12) {
        ap = 'PM';
        if (hour > 12) {
            hour -= 12;  // Convert hour to 12-hour format
        }
    }
    if (minute < 10) {
        minute = '0' + minute;
    }

    var timeStamp = document.getElementById('currentTimeSpan');
    
    timeStamp.innerHTML = months[month] + ' ' + day + ', ' + hour + ':' + minute + ' ' + ap;
</script>";
?>

	
